import React from "react";
import { Route, BrowserRouter } from "react-router-dom";
import TelaCadastroDeUsuario from "./Screen/TelaDeCadastroDeUsuario";
import TelaCadastroDeQuadras from "./Screen/TelaDeCasdastroDeQuadras";
import TelaMenu from "./Screen/TelaMenu";
import Tela404 from "./Screen/Tela404";

const Rotas = () => {
  return (
    <BrowserRouter>
      <Route component={TelaCadastroDeUsuario} path="/cadastroUsuario" />
      <Route component={TelaCadastroDeQuadras} path="/cadastroQuadra" />
      <Route component={TelaMenu} path="/" exact />
      <Route component={Tela404} path="*" />
    </BrowserRouter>
  );
};

export default Rotas;
